import React from 'react';
import { useState } from 'react';


import Head from '../head/head';
import Footer from '../footer/footer';
import Listado from '../listado/listado';

function Index() {
  const [setData] = useState('');

  const data = [
      {
        "ropa": "abrigo"
      },
      {
        "ropa": "gorro2"
      },
      {
        "ropa": "gorro3"
      },
      {
        "ropa": "gorro4"
      }
  ]

  return (
    <div className="App">
      <Head/>
      <div className="banner">
        <img className="banner" src="/assets/banner-hombre.png"/>
      </div>
      <Listado list={data}/>


    <div>
    <section class="lo_mas_top slick-cat -mg_lr bg-custom-color" id="Lomastop" data-js="lo_mas_top">
      <h2 class="title-category" data-js="js-carrousel_d" data-id="Lomastop">
        <img class="icon-rd-start" src="https://oechsle.vteximg.com.br/arquivos/icon-rd-start.svg?v=637050205108300000" alt="Lo más top"/>
          Lo más top
      </h2>
		</section>  
    </div>

      <Footer/>
    </div>
  );
}

export default Index;
